package com.zeynepaslierhan.memorygame

import android.graphics.Bitmap
import android.graphics.BitmapFactory
import android.util.Base64

class CardsFromFirebase {

    lateinit var decoded_cardBackground : Bitmap

    lateinit var decoded_card1: Bitmap

    fun cardSetting(){

        // Kart ArkasÄ±
        val CardBacground_64 = ""

        val cardBackground_bytes = Base64.decode(CardBacground_64, Base64.DEFAULT)
        decoded_cardBackground = BitmapFactory.decodeByteArray(cardBackground_bytes, 0, cardBackground_bytes.size)

        val Card1_64 = ""

        val card1_bytes = Base64.decode(CardBacground_64, Base64.DEFAULT)
        decoded_card1 = BitmapFactory.decodeByteArray(card1_bytes, 0, card1_bytes.size)

    }

}